webpackJsonp([0xe5dced3d36bf],{3913:function(e,a){e.exports={data:{challengeNode:{title:"Understanding Case Sensitivity in Variables",description:["In JavaScript all variables and function names are case sensitive. This means that capitalization matters.","<code>MYVAR</code> is not the same as <code>MyVar</code> nor <code>myvar</code>. It is possible to have multiple distinct variables with the same name but different casing. It is strongly recommended that for the sake of clarity, you <em>do not</em> use this language feature.","<h4>Best Practice</h4>","Write variable names in JavaScript in <dfn>camelCase</dfn>. In <dfn>camelCase</dfn>, multi-word variable names have the first word in lowercase and the first letter of each subsequent word is capitalized.","<strong>Examples:</strong>","<blockquote>var someVariable;<br>var anotherVariableName;<br>var thisVariableNameIsSoLong;</blockquote>","<hr>","Modify the existing declarations and assignments so their names use <dfn>camelCase</dfn>.<br>Do not create any new variables."],challengeType:1,videoUrl:null,fields:{slug:"/javascript-algorithms-and-data-structures/basic-javascript/understanding-case-sensitivity-in-variables",blockName:"Basic JavaScript",tests:[{text:"<code>studlyCapVar</code> is defined and has a value of <code>10</code>",testString:"assert(typeof studlyCapVar !== 'undefined' && studlyCapVar === 10, '<code>studlyCapVar</code> is defined and has a value of <code>10</code>');"},{text:'<code>properCamelCase</code> is defined and has a value of <code>"A String"</code>',testString:"assert(typeof properCamelCase !== 'undefined' && properCamelCase === \"A String\", '<code>properCamelCase</code> is defined and has a value of <code>\"A String\"</code>');"},{text:"<code>titleCaseOver</code> is defined and has a value of <code>9000</code>",testString:"assert(typeof titleCaseOver !== 'undefined' && titleCaseOver === 9000, '<code>titleCaseOver</code> is defined and has a value of <code>9000</code>');"},{text:"<code>studlyCapVar</code> should use camelCase in both declaration and assignment sections.",testString:"assert(code.match(/studlyCapVar/g).length === 2, '<code>studlyCapVar</code> should use camelCase in both declaration and assignment sections.');"},{text:"<code>properCamelCase</code> should use camelCase in both declaration and assignment sections.",testString:"assert(code.match(/properCamelCase/g).length === 2, '<code>properCamelCase</code> should use camelCase in both declaration and assignment sections.');"},{text:"<code>titleCaseOver</code> should use camelCase in both declaration and assignment sections.",testString:"assert(code.match(/titleCaseOver/g).length === 2, '<code>titleCaseOver</code> should use camelCase in both declaration and assignment sections.');"}]},required:[],files:{indexhtml:null,indexjs:{key:"indexjs",ext:"js",name:"index",contents:'// Declarations\nvar StUdLyCapVaR;\nvar properCamelCase;\nvar TitleCaseOver;\n\n// Assignments\nSTUDLYCAPVAR = 10;\nPRoperCAmelCAse = "A String";\ntITLEcASEoVER = 9000;',head:"",tail:""},indexjsx:null}}},pathContext:{challengeMeta:{introPath:"",template:null,required:[],nextChallengePath:"/javascript-algorithms-and-data-structures/basic-javascript/add-two-numbers-with-javascript",id:"56533eb9ac21ba0edf2244ab"},slug:"/javascript-algorithms-and-data-structures/basic-javascript/understanding-case-sensitivity-in-variables"}}}});
